let tableDocentes;
let divLoading = document.querySelector("#divLoading");

document.addEventListener("DOMContentLoaded", function () {
  currentdate = new Date();
  tableDocentes = $("#tableDocentes").dataTable({
    aProcessing: true,
    aServerSide: true,
    language: {
      url: " " + base_url + "/Assets/js/datatable-spanish.json",
    },
    ajax: {
      url: " " + base_url + "/Docentes/getDocentes",
      dataSrc: "",
    },
    columns: [
      { data: "options" },
      { data: "nombre_docente" },
      { data: "apellido_docente" },
      { data: "cedula" },
      { data: "celular_docente" },
      { data: "correo_docente" },
      { data: "nombre_especialidad" },
      { data: "status" },
    ],
    dom: "lBfrtip",
    buttons: [
      {
        extend: "excelHtml5",
        text: "<i class='fas fa-file-excel'></i> Excel",
        titleAttr: "Exportar a Excel",
        className: "btn btn-success",
        exportOptions: {
          columns: [1, 2, 3, 4, 5, 6],
        },
      },
      {
        extend: "pdfHtml5",
        text: "<i class='fas fa-file-pdf'></i> PDF",
        titleAttr: "Exportar a PDF",
        className: "btn btn-danger",
        messageTop:
          "Fecha:" +
          currentdate.getDate() +
          "/" +
          (currentdate.getMonth() + 1) +
          "/" +
          currentdate.getFullYear(),
        exportOptions: {
          columns: [1, 2, 3, 4, 5, 6],
        },
        customize: function (doc) {
          doc.content.splice(0, 0, {
            columns: [
              {
                margin: 12,
                alignment: "left",
                image:
                  "data:image/png;base64,",
                width: 50,
                height: 50,
              },
            ],
          });
        },
      },
      {
        extend: "csvHtml5",
        text: "<i class='fas fa-file-csv'></i> CSV",
        titleAttr: "Exportar a CSV",
        className: "btn btn-info",
        exportOptions: {
            columns: [1, 2, 3, 4, 5, 6],
          },
        
      },
    ],
    resonsieve: "true",
    bDestroy: true,
    iDisplayLength: 10,
    order: [[0, "desc"]],
  });

  //NUEVO DOCENTE
  if (document.querySelector("#formDocente")) {
    let formDocente = document.querySelector("#formDocente");
    formDocente.onsubmit = function (e) {
      e.preventDefault();

      let intId_docente = document.querySelector("#id_docente").value;
      let strNombre = document.querySelector("#nombreDocente").value;
      let strApellido = document.querySelector("#apellidoDocente").value;
      let strcedula = document.querySelector("#cedulaDocente").value;
      let intTelefono = document.querySelector("#telefonoDocente").value;
      let strEmail = document.querySelector("#emailDocente").value;
      let intStatus = document.querySelector("#listStatus").value;

      if (strNombre == "" || strApellido == "" || strcedula == "" || intTelefono == "" || strEmail == "" || intStatus == "") {
        swal("Atencin", "Todos los campos son obligatorios.", "error");
        return false;
      }

      let elementsValid = document.getElementsByClassName("valid");
      for (let i = 0; i < elementsValid.length; i++) {
        if (elementsValid[i].classList.contains("is-invalid")) {
          swal("Atencin", "Por favor verifique los campos en rojo.", "error");
          return false;
        }
      }

      let request = window.XMLHttpRequest
        ? new XMLHttpRequest()
        : new ActiveXObject("Microsoft.XMLHTTP");
      let ajaxUrl = base_url + "/Docentes/setDocente";
      let formData = new FormData(formDocente);
      request.open("POST", ajaxUrl, true);
      request.send(formData);

      request.onreadystatechange = function () {
        if (request.readyState == 4 && request.status == 200) {
          let objData = JSON.parse(request.responseText);
          if (objData.status) {
            $("#modalFormDocente").modal("hide");
            formDocente.reset();
            swal("Docente", objData.msg, "success");
            tableDocentes.api().ajax.reload(function () {});
          } else {
            swal("Error", objData.msg, "error");
          }
        }
      };
    };
  }
});

$("#tableDocentes").DataTable();

function openModal() {
    document.querySelector("#id_docente").value = "";
    document.querySelector(".modal-header").classList.replace("headerUpdate", "headerRegister");
    document.querySelector("#btnActionForm").classList.replace("btn-info", "btn-primary");
    document.querySelector("#btnText").innerHTML = "Guardar";
    document.querySelector("#titleModal").innerHTML = "Nuevo Docente";
    document.querySelector("#formDocente").reset();
  
    $("#modalFormDocente").modal("show");
  }


  window.addEventListener(
    "load",
    function () {
      fntEspecialidad();
     
    },
    false
  );
  
  function fntEspecialidad() {
    if (document.querySelector("#listEspecialidad")) {
      let ajaxUrl = base_url + "/Docentes/getSelectEspecialidad";
      let request = window.XMLHttpRequest
        ? new XMLHttpRequest()
        : new ActiveXObject("Microsoft.XMLHTTP");
      request.open("GET", ajaxUrl, true);
      request.send();
  
      request.onreadystatechange = function () {
        if (request.readyState == 4 && request.status == 200) {
          document.querySelector("#listEspecialidad").innerHTML =
            request.responseText;
          document.querySelector("#listEspecialidad").value = "";
          $("#listEspecialidad").selectpicker("render");
        }
      };
    }
  }


  function fntEditDocente(id_docente) {
  document.querySelector("#titleModal").innerHTML = "Actualizar Docente";
  document.querySelector(".modal-header").classList.replace("headerRegister", "headerUpdate");
  document.querySelector("#btnActionForm").classList.replace("btn-primary", "btn-info");
  document.querySelector("#btnText").innerHTML = "Actualizar";

  divLoading.style.display = "flex";

  let request = window.XMLHttpRequest
    ? new XMLHttpRequest()
    : new ActiveXObject("Microsoft.XMLHTTP");
  let ajaxUrl = base_url + "/Docentes/getDocente/" + id_docente;
  
  request.open("GET", ajaxUrl, true);
  request.send();

  request.onreadystatechange = function () {
    if (request.readyState == 4 && request.status == 200) {
      let objData = JSON.parse(request.responseText);


      if (objData.status) {
        document.querySelector("#id_docente").value = objData.data.id_docentes;
        document.querySelector("#nombreDocente").value = objData.data.nombre_docente;
        document.querySelector("#apellidoDocente").value = objData.data.apellido_docente;
        document.querySelector("#listNacionalidad_docente").value = objData.data.nacionalidad_docente;
        document.querySelector("#cedulaDocente").value = objData.data.cedula_docente;
        document.querySelector("#telefonoDocente").value = objData.data.celular_docente;
        document.querySelector("#emailDocente").value = objData.data.correo_docente;
        document.querySelector('#listEspecialidad').value = objData.data.id_especialidad;
        document.querySelector("#listStatus").value = objData.data.status;

        
        $("#listNacionalidad_docente").selectpicker("render");
        $("#listEspecialidad").selectpicker("render");
        $("#listStatus").selectpicker("render");
        

        $("#modalFormDocente").modal("show");
      } else {
        swal("Error", objData.msg, "error");
      }
    }
    divLoading.style.display = "none";
    return false;
  };
}

function fntDelDocente(id_docente) {
  swal(
    {
      title: "Eliminar Docente",
      text: "Realmente quiere eliminar el Docente?",
      type: "warning",
      showCancelButton: true,
      confirmButtonText: "Si, eliminar!",
      cancelButtonText: "No, cancelar!",
      closeOnConfirm: false,
      closeOnCancel: true,
    },
    function (isConfirm) {
      if (isConfirm) {
        let request = window.XMLHttpRequest
          ? new XMLHttpRequest()
          : new ActiveXObject("Microsoft.XMLHTTP");
        let ajaxUrl = base_url + "/Docentes/delDocente/";
        let strData = "id_docente=" + id_docente;
        request.open("POST", ajaxUrl, true);
        request.setRequestHeader(
          "Content-type",
          "application/x-www-form-urlencoded"
        );
        request.send(strData);
        request.onreadystatechange = function () {
          if (request.readyState == 4 && request.status == 200) {
            let objData = JSON.parse(request.responseText);
            if (objData.status) {
              swal("Eliminar!", objData.msg, "success");
              tableDocentes.api().ajax.reload(function () {});
            } else {
              swal("Atencin!", objData.msg, "error");
            }
          }
        };
      }
    }
  );
}

function ftnViewDocente(id_docente)
{
    
           
            let  request = (window.XMLHttpRequest) ? new XMLHttpRequest() : new ActiveXObject('Microsoft.XMLHTTP');
            let  ajaxUrl = base_url+'/Docentes/getDocente/'+id_docente; 
            request.open("GET",ajaxUrl,true);
            request.send();
             request.onreadystatechange = function(){
        if(request.readyState == 4 && request.status == 200){
            let  objData = JSON.parse(request.responseText);

            if(objData.status)
            {
               let  estadoDocente = objData.data.status == 1 
                ? '<span class="badge badge-success">Activo</span>' 
                : '<span class="badge badge-danger">Inactivo</span>';

            
                document.querySelector("#celNombre").innerHTML = objData.data.nombre_docente;
                document.querySelector("#celApellido").innerHTML = objData.data.apellido_docente;
                document.querySelector("#celCedula").innerHTML = objData.data.cedula;
                document.querySelector("#celTelefono").innerHTML = objData.data.celular_docente;
                document.querySelector("#celEmail").innerHTML = objData.data.correo_docente;
                document.querySelector("#celEspecialidad").innerHTML = objData.data.nombre_especialidad;
                document.querySelector("#celEstado").innerHTML = estadoDocente;
             
                $('#modalViewDocente').modal('show');
            }else{
                swal("Error", objData.msg , "error");
            }
        }
    }

}
